import { Routes, Route, Navigate } from "react-router-dom";
import routes from "./routes";

function App() {
  return (
    <>
      <Routes>
        {routes.map(
          ({ path, element, children }, key) =>
            element && <Route key={key} exact path={path} element={element} children={children} />
        )}
        {/*<Route path="*" element={<Navigate to="/home" replace />} />*/}
      </Routes>
    </>
  );
}

export default App;
